import React from 'react';


function Header() {
    return (
      <div className='navbar'>
        <div className="navbar-brand">
        <h1>URL Shortener</h1>

          <ul >
            <a href="/">Home </a>
            <a href="/user/login"> Login </a>
            <a href="/user/signup"> Signup </a>
          </ul>
          </div>
      </div>

    );
  }

  export default Header;
